import React, {useState} from 'react';
import { TextField, Button, Container, Stack } from '@mui/material';
import { Link } from "react-router-dom"

const ProductForm = () => {
    const [productName, setproductName] = useState('')
    const [category, setcategory] = useState('')
    const [base, setbase] = useState('')
    const [price, setprice] = useState('')
    const [where, setwhere] = useState('')
    const [siteurl, setsiteurl] = useState('')
    const [imageurl, setimageurl] = useState('')



    function handleSubmit(event) {
        event.preventDefault();
      //  console.log(firstName, lastName, email, dateOfBirth, password) 
    }

    return (
        <React.Fragment>
            <h2>Product Form</h2>
            <form onSubmit={handleSubmit} action={<Link to="/homepage" />}>
            <Stack spacing={2} direction="row" sx={{marginBottom: 4}}>
                    <TextField
                        type="text"
                        variant='outlined'
                        color='secondary'
                        label="Product Name"
                        onChange={e => setproductName(e.target.value)}
                        value={productName}
                        fullWidth
                        required
                    />
                    <TextField
                        type="text"
                        variant='outlined'
                        color='secondary'
                        label="Merchant "
                        onChange={e => setwhere(e.target.value)}
                        value={where}
                        fullWidth
                        required
                    />
                </Stack>
                <Stack spacing={2} direction="row" sx={{marginBottom: 4}}>
                    <TextField
                        type="text"
                        variant='outlined'
                        color='secondary'
                        label="Base "
                        onChange={e => setbase(e.target.value)}
                        value={base}
                        fullWidth
                        required
                    />
                    <TextField
                        type="text"
                        variant='outlined'
                        color='secondary'
                        label="Price "
                        onChange={e => setprice(e.target.value)}
                        value={price}
                        fullWidth
                        required
                    />
                </Stack>               
                <TextField
                    type="url"
                    variant='outlined'
                    color='secondary'
                    label="Site URL"
                    onChange={e => setsiteurl(e.target.value)}
                    value={siteurl}
                    fullWidth
                    required
                    sx={{mb: 4}}
                />
                <TextField
                    type="url"
                    variant='outlined'
                    color='secondary'
                    label="Image URL"
                    onChange={e => setimageurl(e.target.value)}
                    value={imageurl}
                    required
                    fullWidth
                    sx={{mb: 4}}
                />
         <InputLabel> Category</InputLabel>
        <Select
          value={category}
         // onChange={handleChange}
          autoWidth
          label="Cateogory"
        >
          <MenuItem value={1}>CPU</MenuItem>
          <MenuItem value={2}>CPU Cooler</MenuItem>
          <MenuItem value={3}>Motherboard</MenuItem>
          <MenuItem value={4}>Memory</MenuItem>
          <MenuItem value={5}>Storage</MenuItem>
          <MenuItem value={6}>Video Card</MenuItem> 
          <MenuItem value={7}>Power Supplies</MenuItem>
          <MenuItem value={8}>Cases</MenuItem>
          <MenuItem value={9}>Peripherals</MenuItem>  
          <MenuItem value={10}>Accessories</MenuItem>                     

        </Select>
                <Button variant="outlined" color="secondary" type="submit">Post</Button>
            </form>     
        </React.Fragment>
    )
}

export default ProductForm;
